import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from "react-router-dom";
import Login from "./components/Login"; // Import Login component
import Register from "./components/Register"; // Import Register component
import Reserve from "./components/Reserve"; // Import Reserve component

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false); // Track user authentication status

  const handleLoginSuccess = () => {
    setIsAuthenticated(true); // Set authentication status to true after login
  };

  const handleLogout = () => {
    setIsAuthenticated(false); // Reset authentication status on logout
  };

  return (
    <Router>
      <div>
        <h1>Welcome to CloudProject</h1>
        {!isAuthenticated ? (
          <nav>
            <Link to="/login">Login</Link>
            <br />
            <Link to="/register">Register</Link>
          </nav>
        ) : (
          <nav>
            <button onClick={handleLogout}>Logout</button>
          </nav>
        )}

        <Routes>
          {/* Public Routes */}
          <Route path="/login" element={<Login onLoginSuccess={handleLoginSuccess} />} />
          <Route path="/register" element={<Register />} />

          {/* Protected Route */}
          <Route
            path="/reserve"
            element={
              isAuthenticated ? <Reserve /> : <Navigate to="/login" replace />
            }
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
